function [c_R, gradc_R] = constraint_dynamics_stable_z(A)
	%CONSTRAINT_DYNAMICS_STABLE_Z return inequality constraints and constraint gradients for stable system matrix in discrete time
	%	Input:
	%		A:			system matrix to calculate constraints at
	%	Output:
	%		c_R:		inequality constraints for stable A in z domain (with necessary and sufficient stability conditions for order <= 5 and necessary conditions for order > 5)
	%		gradc_R:	gradient of inequality constraints for stable A in z domain
	if size(A, 1) ~= size(A, 2)
		error('control:design:outputfeedback:input', 'System matrix must be square.');
	end
	switch size(A, 1)
		case 0
			c_R = zeros(0, 1);
			gradc_R = zeros(0, 0, 0);
		case 1
			c_R = [
				A - 1;
				-A - 1
			];
			gradc_R = cat(3, 1, -1);
		case 2
			a_1 = -(A(1, 1) + A(2, 2));
			a_0 = A(1, 1)*A(2, 2) - A(1, 2)*A(2, 1);
			c_R = [
				-a_1 - a_0;%-N(1) < 0
				a_1 - a_0;%-N(-1) < 0
				a_0 - 1;
				-a_0 - 1
			];
			gradc_R = cat(3, [
				1 - A(2, 2),	A(2, 1);
				A(1, 2),		1 - A(1, 1)
			], [
				-1 - A(2, 2),	A(2, 1);
				A(1, 2),		-1 - A(1, 1)
			], [
				A(2, 2),		-A(2, 1);
				-A(1, 2),		A(1, 1)
			], [
				-A(2, 2),		A(2, 1);
				A(1, 2),		-A(1, 1)
			]);
		case 3
			%[ a, b, c]
			%[ d, e, f]
			%[ g, h, i]
			%s^3 + (- a - e - i)*s^2 + (a*e - b*d + a*i - c*g + e*i - f*h)*s - a*e*i + a*f*h + b*d*i - b*f*g - c*d*h + c*e*g
			a_2 = -A(1, 1) - A(2, 2) - A(3, 3);
			a_1 = A(1, 1)*A(2, 2) - A(1, 2)*A(1, 2) + A(1, 1)*A(3, 3) - A(1, 3)*A(3, 1) + A(2, 2)*A(3, 3) - A(2, 3)*A(3, 2);
			a_0 = -A(1, 1)*A(2, 2)*A(3, 3) + A(1, 1)*A(2, 3)*A(3, 2) + A(1, 2)*A(2, 1)*A(3, 3) - A(1, 2)*A(2, 3)*A(3, 1) - A(1, 3)*A(2, 1)*A(3, 2) + A(1, 3)*A(2, 2)*A(3, 1);
			c_R = [
				-(1 + a_2 + a_1 + a_0);%-N(1) < 0
				-(-1 + a_2 - a_1 + a_0);%-N(-1) < 0
				a_0 - 1;
				-a_0 - 1;
				a_1 - a_0*a_2 - 1 - a_0^2
			];
			da_2 = -eye(3);
			da_1 = [
				A(2, 2) + A(3, 3),	-A(2, 1),					-A(3, 1);
				-A(1, 2),			A(1, 1) + A(3, 3),			-A(3, 2);
				-A(1, 3),			-A(2, 3),					A(1, 1) + A(2, 2)
			];
			da_0 = [
				-A(2, 2)*A(3, 3) + A(2, 3)*A(3, 2),		A(2, 1)*A(3, 3) - A(2, 3)*A(3, 1),	-A(2, 1)*A(3, 2) + A(2, 2)*A(3, 1);
				A(1, 2)*A(3, 3) - A(1, 3)*A(3, 2),		-A(1, 1)*A(3, 3) + A(1, 3)*A(3, 1),	A(1, 1)*A(3, 2) - A(1, 2)*A(3, 1);
				- A(1, 2)*A(2, 3) + A(1, 3)*A(2, 2),	A(1, 1)*A(2, 3) - A(1, 3)*A(2, 1),	-A(1, 1)*A(2, 2) + A(1, 2)*A(2, 1)
			];
			gradc_R = cat(3, -(da_2 + da_1 + da_0), -(da_2 - da_1 + da_0), da_0, -da_0, da_1 - da_0*a_2 - a_0*da_2 - 1 - 2*a_0*da_0);
		case 4
			%s^4 + (- A(1, 1) - A(2, 2) - A(3, 3) - A(4, 4))*s^3 + (A(1, 1)*A(2, 2) - A(1, 2)*A(2, 1) + A(1, 1)*A(3, 3) - A(1, 3)*A(3, 1) + A(1, 1)*A(4, 4) - A(1, 4)*A(4, 1) + A(2, 2)*A(3, 3) - A(2, 3)*A(3, 2) + A(2, 2)*A(4, 4) - A(2, 4)*A(4, 2) + A(3, 3)*A(4, 4) - A(3, 4)*A(4, 3))*s^2 + (A(1, 1)*A(2, 3)*A(3, 2) - A(1, 1)*A(2, 2)*A(3, 3) + A(1, 2)*A(2, 1)*A(3, 3) - A(1, 2)*A(2, 3)*A(3, 1) - A(1, 3)*A(2, 1)*A(3, 2) + A(1, 3)*A(2, 2)*A(3, 1) - A(1, 1)*A(2, 2)*A(4, 4) + A(1, 1)*A(2, 4)*A(4, 2) + A(1, 2)*A(2, 1)*A(4, 4) - A(1, 2)*A(2, 4)*A(4, 1) - A(1, 4)*A(2, 1)*A(4, 2) + A(1, 4)*A(2, 2)*A(4, 1) - A(1, 1)*A(3, 3)*A(4, 4) + A(1, 1)*A(3, 4)*A(4, 3) + A(1, 3)*A(3, 1)*A(4, 4) - A(1, 3)*A(3, 4)*A(4, 1) - A(1, 4)*A(3, 1)*A(4, 3) + A(1, 4)*A(3, 3)*A(4, 1) - A(2, 2)*A(3, 3)*A(4, 4) + A(2, 2)*A(3, 4)*A(4, 3) + A(2, 3)*A(3, 2)*A(4, 4) - A(2, 3)*A(3, 4)*A(4, 2) - A(2, 4)*A(3, 2)*A(4, 3) + A(2, 4)*A(3, 3)*A(4, 2))*s + A(1, 1)*A(2, 2)*A(3, 3)*A(4, 4) - A(1, 1)*A(2, 2)*A(3, 4)*A(4, 3) - A(1, 1)*A(2, 3)*A(3, 2)*A(4, 4) + A(1, 1)*A(2, 3)*A(3, 4)*A(4, 2) + A(1, 1)*A(2, 4)*A(3, 2)*A(4, 3) - A(1, 1)*A(2, 4)*A(3, 3)*A(4, 2) - A(1, 2)*A(2, 1)*A(3, 3)*A(4, 4) + A(1, 2)*A(2, 1)*A(3, 4)*A(4, 3) + A(1, 2)*A(2, 3)*A(3, 1)*A(4, 4) - A(1, 2)*A(2, 3)*A(3, 4)*A(4, 1) - A(1, 2)*A(2, 4)*A(3, 1)*A(4, 3) + A(1, 2)*A(2, 4)*A(3, 3)*A(4, 1) + A(1, 3)*A(2, 1)*A(3, 2)*A(4, 4) - A(1, 3)*A(2, 1)*A(3, 4)*A(4, 2) - A(1, 3)*A(2, 2)*A(3, 1)*A(4, 4) + A(1, 3)*A(2, 2)*A(3, 4)*A(4, 1) + A(1, 3)*A(2, 4)*A(3, 1)*A(4, 2) - A(1, 3)*A(2, 4)*A(3, 2)*A(4, 1) - A(1, 4)*A(2, 1)*A(3, 2)*A(4, 3) + A(1, 4)*A(2, 1)*A(3, 3)*A(4, 2) + A(1, 4)*A(2, 2)*A(3, 1)*A(4, 3) - A(1, 4)*A(2, 2)*A(3, 3)*A(4, 1) - A(1, 4)*A(2, 3)*A(3, 1)*A(4, 2) + A(1, 4)*A(2, 3)*A(3, 2)*A(4, 1)
			a_3 = - A(1, 1) - A(2, 2) - A(3, 3) - A(4, 4);
			a_2 = A(1, 1)*A(2, 2) - A(1, 2)*A(2, 1) + A(1, 1)*A(3, 3) - A(1, 3)*A(3, 1) + A(1, 1)*A(4, 4) - A(1, 4)*A(4, 1) + A(2, 2)*A(3, 3) - A(2, 3)*A(3, 2) + A(2, 2)*A(4, 4) - A(2, 4)*A(4, 2) + A(3, 3)*A(4, 4) - A(3, 4)*A(4, 3);
			
			a_1 = A(1, 1)*A(2, 3)*A(3, 2) - A(1, 1)*A(2, 2)*A(3, 3) + A(1, 2)*A(2, 1)*A(3, 3) - A(1, 2)*A(2, 3)*A(3, 1) - A(1, 3)*A(2, 1)*A(3, 2) + A(1, 3)*A(2, 2)*A(3, 1) - A(1, 1)*A(2, 2)*A(4, 4) + A(1, 1)*A(2, 4)*A(4, 2) + A(1, 2)*A(2, 1)*A(4, 4) - A(1, 2)*A(2, 4)*A(4, 1) - A(1, 4)*A(2, 1)*A(4, 2) + A(1, 4)*A(2, 2)*A(4, 1) - A(1, 1)*A(3, 3)*A(4, 4) + A(1, 1)*A(3, 4)*A(4, 3) + A(1, 3)*A(3, 1)*A(4, 4) - A(1, 3)*A(3, 4)*A(4, 1) - A(1, 4)*A(3, 1)*A(4, 3) + A(1, 4)*A(3, 3)*A(4, 1) - A(2, 2)*A(3, 3)*A(4, 4) + A(2, 2)*A(3, 4)*A(4, 3) + A(2, 3)*A(3, 2)*A(4, 4) - A(2, 3)*A(3, 4)*A(4, 2) - A(2, 4)*A(3, 2)*A(4, 3) + A(2, 4)*A(3, 3)*A(4, 2);
			a_0 = A(1, 1)*A(2, 2)*A(3, 3)*A(4, 4) - A(1, 1)*A(2, 2)*A(3, 4)*A(4, 3) - A(1, 1)*A(2, 3)*A(3, 2)*A(4, 4) + A(1, 1)*A(2, 3)*A(3, 4)*A(4, 2) + A(1, 1)*A(2, 4)*A(3, 2)*A(4, 3) - A(1, 1)*A(2, 4)*A(3, 3)*A(4, 2) - A(1, 2)*A(2, 1)*A(3, 3)*A(4, 4) + A(1, 2)*A(2, 1)*A(3, 4)*A(4, 3) + A(1, 2)*A(2, 3)*A(3, 1)*A(4, 4) - A(1, 2)*A(2, 3)*A(3, 4)*A(4, 1) - A(1, 2)*A(2, 4)*A(3, 1)*A(4, 3) + A(1, 2)*A(2, 4)*A(3, 3)*A(4, 1) + A(1, 3)*A(2, 1)*A(3, 2)*A(4, 4) - A(1, 3)*A(2, 1)*A(3, 4)*A(4, 2) - A(1, 3)*A(2, 2)*A(3, 1)*A(4, 4) + A(1, 3)*A(2, 2)*A(3, 4)*A(4, 1) + A(1, 3)*A(2, 4)*A(3, 1)*A(4, 2) - A(1, 3)*A(2, 4)*A(3, 2)*A(4, 1) - A(1, 4)*A(2, 1)*A(3, 2)*A(4, 3) + A(1, 4)*A(2, 1)*A(3, 3)*A(4, 2) + A(1, 4)*A(2, 2)*A(3, 1)*A(4, 3) - A(1, 4)*A(2, 2)*A(3, 3)*A(4, 1) - A(1, 4)*A(2, 3)*A(3, 1)*A(4, 2) + A(1, 4)*A(2, 3)*A(3, 2)*A(4, 1);
			da_3 = -eye(4);
			da_2 = [
				A(2, 2) + A(3, 3) + A(4, 4),	-A(2, 1),						-A(3, 1),						-A(4, 1);
				-A(1, 2),						A(1, 1) + A(3, 3) + A(4, 4),	-A(3, 2),						-A(4, 2);
				-A(1, 3),						-A(2, 3),						A(1, 1) + A(2, 2) + A(4, 4),	-A(4, 3);
				-A(1, 4),						-A(2, 4),						-A(3, 4),						A(1, 1) + A(2, 2) + A(3, 3)
			];
			da_1 = [
				A(2, 3)*A(3, 2) - A(2, 2)*A(3, 3) - A(2, 2)*A(4, 4) + A(2, 4)*A(4, 2)- A(3, 3)*A(4, 4) + A(3, 4)*A(4, 3),	A(2, 1)*A(3, 3) - A(2, 3)*A(3, 1) + A(2, 1)*A(4, 4) - A(2, 4)*A(4, 1),											-A(2, 1)*A(3, 2) + A(2, 2)*A(3, 1) + A(3, 1)*A(4, 4) - A(3, 4)*A(4, 1),											-A(2, 1)*A(4, 2) + A(2, 2)*A(4, 1) - A(3, 1)*A(4, 3) + A(3, 3)*A(4, 1);
				A(1, 2)*A(3, 3) - A(1, 3)*A(3, 2) + A(1, 2)*A(4, 4) - A(1, 4)*A(4, 2),										-A(1, 1)*A(3, 3) + A(1, 3)*A(3, 1) - A(1, 1)*A(4, 4) + A(1, 4)*A(4, 1) - A(3, 3)*A(4, 4) + A(3, 4)*A(4, 3),		A(1, 1)*A(3, 2) - A(1, 2)*A(3, 1) + A(3, 2)*A(4, 4) - A(3, 4)*A(4, 2),											A(1, 1)*A(4, 2) - A(1, 2)*A(4, 1) - A(3, 2)*A(4, 3) + A(3, 3)*A(4, 2);
				-A(1, 2)*A(2, 3) + A(1, 3)*A(2, 2) + A(1, 3)*A(4, 4) - A(1, 4)*A(4, 3),										A(1, 1)*A(2, 3) - A(1, 3)*A(2, 1) + A(2, 3)*A(4, 4) - A(2, 4)*A(4, 3),											-A(1, 1)*A(2, 2) + A(1, 2)*A(2, 1) - A(1, 1)*A(4, 4) + A(1, 4)*A(4, 1) - A(2, 2)*A(4, 4) + A(2,	4)*A(4, 2),		A(1, 1)*A(4, 3) - A(1, 3)*A(4, 1) + A(2, 2)*A(4, 3) - A(2, 3)*A(4, 2);
				-A(1, 2)*A(2, 4) + A(1, 4)*A(2, 2) - A(1, 3)*A(3, 4) + A(1, 4)*A(3, 3),										A(1, 1)*A(2, 4) - A(1, 4)*A(2, 1) - A(2, 3)*A(3, 4) + A(2, 4)*A(3, 3),											A(1, 1)*A(3, 4) - A(1, 4)*A(3, 1) + A(2, 2)*A(3, 4) - A(2, 4)*A(3, 2),											-A(1, 1)*A(2, 2) + A(1, 2)*A(2, 1) - A(1, 1)*A(3, 3) + A(1, 3)*A(3, 1) - A(2, 2)*A(3, 3) + A(2, 3)*A(3, 2)
			];
			da_0 = [
				A(2, 2)*A(3, 3)*A(4, 4) - A(2, 2)*A(3, 4)*A(4, 3) - A(2, 3)*A(3, 2)*A(4, 4) + A(2, 3)*A(3, 4)*A(4, 2) + A(2, 4)*A(3, 2)*A(4, 3) - A(2, 4)*A(3, 3)*A(4, 2),	A(2, 1)*A(3, 4)*A(4, 3) - A(2, 1)*A(3, 3)*A(4, 4) + A(2, 3)*A(3, 1)*A(4, 4) - A(2, 3)*A(3, 4)*A(4, 1) - A(2, 4)*A(3, 1)*A(4, 3) + A(2, 4)*A(3, 3)*A(4, 1),	A(2, 1)*A(3, 2)*A(4, 4) - A(2, 1)*A(3, 4)*A(4, 2) - A(2, 2)*A(3, 1)*A(4, 4) + A(2, 2)*A(3, 4)*A(4, 1) + A(2, 4)*A(3, 1)*A(4, 2) - A(2, 4)*A(3, 2)*A(4, 1),	A(2, 1)*A(3, 3)*A(4, 2) - A(2, 1)*A(3, 2)*A(4, 3) + A(2, 2)*A(3, 1)*A(4, 3) - A(2, 2)*A(3, 3)*A(4, 1) - A(2, 3)*A(3, 1)*A(4, 2) + A(2, 3)*A(3, 2)*A(4, 1);
				A(1, 2)*A(3, 4)*A(4, 3) - A(1, 2)*A(3, 3)*A(4, 4) + A(1, 3)*A(3, 2)*A(4, 4) - A(1, 3)*A(3, 4)*A(4, 2) - A(1, 4)*A(3, 2)*A(4, 3) + A(1, 4)*A(3, 3)*A(4, 2),	A(1, 1)*A(3, 3)*A(4, 4) - A(1, 1)*A(3, 4)*A(4, 3) - A(1, 3)*A(3, 1)*A(4, 4) + A(1, 3)*A(3, 4)*A(4, 1) + A(1, 4)*A(3, 1)*A(4, 3) - A(1, 4)*A(3, 3)*A(4, 1),	A(1, 1)*A(3, 4)*A(4, 2) - A(1, 1)*A(3, 2)*A(4, 4) + A(1, 2)*A(3, 1)*A(4, 4) - A(1, 2)*A(3, 4)*A(4, 1) - A(1, 4)*A(3, 1)*A(4, 2) + A(1, 4)*A(3, 2)*A(4, 1),	A(1, 1)*A(3, 2)*A(4, 3) - A(1, 1)*A(3, 3)*A(4, 2) - A(1, 2)*A(3, 1)*A(4, 3) + A(1, 2)*A(3, 3)*A(4, 1) + A(1, 3)*A(3, 1)*A(4, 2) - A(1, 3)*A(3, 2)*A(4, 1);
				A(1, 2)*A(2, 3)*A(4, 4) - A(1, 2)*A(2, 4)*A(4, 3) - A(1, 3)*A(2, 2)*A(4, 4) + A(1, 3)*A(2, 4)*A(4, 2) + A(1, 4)*A(2, 2)*A(4, 3) - A(1, 4)*A(2, 3)*A(4, 2),	A(1, 1)*A(2, 4)*A(4, 3) - A(1, 1)*A(2, 3)*A(4, 4) + A(1, 3)*A(2, 1)*A(4, 4) - A(1, 3)*A(2, 4)*A(4, 1) - A(1, 4)*A(2, 1)*A(4, 3) + A(1, 4)*A(2, 3)*A(4, 1),	A(1, 1)*A(2, 2)*A(4, 4) - A(1, 1)*A(2, 4)*A(4, 2) - A(1, 2)*A(2, 1)*A(4, 4) + A(1, 2)*A(2, 4)*A(4, 1) + A(1, 4)*A(2, 1)*A(4, 2) - A(1, 4)*A(2, 2)*A(4, 1),	A(1, 1)*A(2, 3)*A(4, 2) - A(1, 1)*A(2, 2)*A(4, 3) + A(1, 2)*A(2, 1)*A(4, 3) - A(1, 2)*A(2, 3)*A(4, 1) - A(1, 3)*A(2, 1)*A(4, 2) + A(1, 3)*A(2, 2)*A(4, 1);
				A(1, 2)*A(2, 4)*A(3, 3) - A(1, 2)*A(2, 3)*A(3, 4) + A(1, 3)*A(2, 2)*A(3, 4) - A(1, 3)*A(2, 4)*A(3, 2) - A(1, 4)*A(2, 2)*A(3, 3) + A(1, 4)*A(2, 3)*A(3, 2),	A(1, 1)*A(2, 3)*A(3, 4) - A(1, 1)*A(2, 4)*A(3, 3) - A(1, 3)*A(2, 1)*A(3, 4) + A(1, 3)*A(2, 4)*A(3, 1) + A(1, 4)*A(2, 1)*A(3, 3) - A(1, 4)*A(2, 3)*A(3, 1),	A(1, 1)*A(2, 4)*A(3, 2) - A(1, 1)*A(2, 2)*A(3, 4) + A(1, 2)*A(2, 1)*A(3, 4) - A(1, 2)*A(2, 4)*A(3, 1) - A(1, 4)*A(2, 1)*A(3, 2) + A(1, 4)*A(2, 2)*A(3, 1),	A(1, 1)*A(2, 2)*A(3, 3) - A(1, 1)*A(2, 3)*A(3, 2) - A(1, 2)*A(2, 1)*A(3, 3) + A(1, 2)*A(2, 3)*A(3, 1) + A(1, 3)*A(2, 1)*A(3, 2) - A(1, 3)*A(2, 2)*A(3, 1)
			];
			c_R = [
				-(1 + a_3 + a_2 + a_1 + a_0);% -N(1) < 0
				-(1 - a_3 + a_2 - a_1 + a_0);%-N(-1) < 0
				a_0 - 1;
				-a_0 - 1;
				a_1 - a_0*a_3 - 1 - a_0^2;
				-a_1 + a_0*a_3 - 1 - a_0^2;
				-((1 - a_0)^2*(1 - a_2 + a_0) + (a_3 - a_1)*(a_1 - a_0*a_3))
			];
